    <div className="App">
      <div class="ParentBox">
        <div class="NavBar">
          <div class="HabitRabbit">
            Habbit Rabbit
          </div>
          <div class="Navigation">

          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
